import React, { useState } from 'react';
import { AiOutlineEye, AiOutlineEyeInvisible } from 'react-icons/ai';
import { toast } from 'react-toastify'; // Include ToastContainer
import './Signup.css'; // Import your CSS file

export const Signup = () => {
  const [showCreatePass, setShowCreatePass] = useState(false);
  const [showConfirmPass, setShowConfirmPass] = useState(false);

  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    password: "",
    confirmPassword: "",
  });

  function changeHandler(event) {
    setFormData((prev) => ({
      ...prev,
      [event.target.name]: event.target.value,
    }));
  }

  function submitHandler(e) {
    e.preventDefault();
    if (formData.password !== formData.confirmPassword) {
      toast.error("Passwords do not match");
      return;
    }
    toast.success("Account Created");
    const accountData = {
      ...formData,
    };
    console.log(accountData);
  }

  const postdata_into_database = async (e) =>{
    e.preventDefault();

    const {firstName,lastName,email,password,confirmPassword} = formData;
    const res = await fetch("/createmessage",{
      method : "POST",
      headers : {
        "Content-Type" : "application/json"
      },
      body : JSON.stringify({
        firstName,lastName,email,password,confirmPassword
      })
    });
  }

  return (
    <>
      <div className='heading'>Sign Up for the Register</div>
      <div className="signup-container">
        <form method="POST" onSubmit={submitHandler}>
          <div className="form-group">
            <label className="form-label">
              First Name <sup className="required">*</sup>
            </label>
            <input
              type="text"
              required
              placeholder="Enter First Name"
              onChange={changeHandler}
              value={formData.firstName}
              name="firstName"
              className="form-input"
            />
          </div>

          <div className="form-group">
            <label className="form-label">
              Last Name <sup className="required">*</sup>
            </label>
            <input
              type="text"
              required
              placeholder="Enter Last Name"
              onChange={changeHandler}
              value={formData.lastName}
              name="lastName"
              className="form-input"
            />
          </div>

          <div className="form-group">
            <label className="form-label">
              Email Address <sup className="required">*</sup>
            </label>
            <input
              type="email"
              required
              placeholder="Enter your email address"
              value={formData.email}
              onChange={changeHandler}
              name="email"
              className="form-input"
            />
          </div>

          <div className="form-group password-group">
            <label className="form-label">
              Create Password <sup className="required">*</sup>
            </label>
            <input
              type={showCreatePass ? "text" : "password"}
              required
              placeholder="Enter Password"
              onChange={changeHandler}
              value={formData.password}
              name="password"
              className="form-input"
            />
            <span
              onClick={() => setShowCreatePass(!showCreatePass)}
              className="password-toggle"
            >
              {showCreatePass ? (
                <AiOutlineEyeInvisible fontSize={24} fill="#AFB2BF" />
              ) : (
                <AiOutlineEye fontSize={24} fill="#AFB2BF" />
              )}
            </span>
          </div>

          <div className="form-group password-group">
            <label className="form-label">
              Confirm Password <sup className="required">*</sup>
            </label>
            <input
              type={showConfirmPass ? "text" : "password"}
              required
              placeholder="Confirm Password"
              onChange={changeHandler}
              value={formData.confirmPassword}
              name="confirmPassword"
              className="form-input"
            />
            <span
              onClick={() => setShowConfirmPass(!showConfirmPass)}
              className="password-toggle"
            >
              {showConfirmPass ? (
                <AiOutlineEyeInvisible fontSize={24} fill="#AFB2BF" />
              ) : (
                <AiOutlineEye fontSize={24} fill="#AFB2BF" />
              )}
            </span>
          </div>

          <button type="submit" className="submit-button" onClick={postdata_into_database}>
            Create Account
          </button>
        </form>
      </div>
    </>
  );
};
